import React, {Component} from "react";

class Timeline extends Component {
    render(){
        return(
            <div>
                <div class>
                    <h2>여러분의 소식을 들려주세요</h2>
                    <input type="" />
                </div>
                <h2>타임라인</h2>
                <p>내용</p>
            </div>
        );
    }
}

export default Timeline;
